import { apiStructure } from '../../../server/controllers/apiStructure';
import { API_SUBMIT } from '../constants/actionTypes';

export default apiStructure = (apiStructureList = [], action) => {
  switch (action.type) {
    case API_SUBMIT:
      return [...apiStructureList, action.payload];
    default:
      return apiStructureList;
  }
};
